import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './componants/Home';
import NavBar from './componants/NavBar';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  return (
    <div className="App">
     <BrowserRouter>
     < NavBar />
     <Routes>
      <Route path='/' element={<Home />} />
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
